import React from 'react';

const Team = () => {
  return (
    <div>
      <div>
        <div className="flex pt-24 overflow-hidden justify-center md:justify-end">
          <div className="bg-backgroundTeam w-full md:w-4/5 h-auto py-14 shadow-md md:rounded-tr-full md:rounded-tl-full md:rounded-bl-md">
            <div className="flex flex-col items-center text-center">
              <h2 className="text-3xl font-semibold">Our Recent Projects</h2>
              <h3 className="text-2xl font-thin">By Our Team</h3>
              <p className="mt-3 text-xs max-w-md break-words">We build products close to our heart. We turn your ideas into reality and make your dreams successful with an awesome experience.</p>
            </div>

            <div className="flex justify-center md:pl-20 mt-12">
              <img className="w-full md:w-4/5 h-auto" src="/slider.png" alt="" />
            </div>
          </div>
        </div>

        <p className="font-bold text-center py-2 mt-5">We have collaborated and are trusted by these brands</p>
      </div>

      <div className="flex justify-center">
        <img className="w-full md:w-1/2 h-auto" src="/brands.png" alt='' />
      </div>
    </div>
  );
};

export default Team;
